import React from 'react';
import './searchbar.css';

const Searchbar = () => {

    const inputStyle = {
        margin: "50px auto",
        width: "50%",
        padding: "10px",
        display: "block",
    }

    return (
        <div className="section">
           <input type="text" placeholder="Enter cocktail type..." style={inputStyle}></input>
        </div>
    )
}

export default Searchbar
